import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

function App() {
    const todos = useState([]);

    useEffect(() => {
        const fetchTodos = async () => {
            const res = await axios.get("localhost:8080/data");
            console.log(res);
        };

        fetchTodos();
    }, [todos]);

    return (
        <div className="App">
            <h1>Demo app</h1>
        </div>
    );
}

function List(data) {}

export default App;
